import React from 'react';
import people from './Data/people';


function App() {
  return (
    <div>
      <h1>Uma dada pessoa:</h1>
      {
        people.map(
          (p) => (
            <div>
              <h2>{p.nome}</h2>
              <p>{p.idade}</p>
              <p>{p.peso}</p>
            </div>
          )
        )
      }
    </div>

  );
}

export default App;
